import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/swiper.min.css";
import "swiper/components/effect-coverflow/effect-coverflow.min.css";
import "swiper/components/pagination/pagination.min.css";

import classes from "./Project.module.css";


// Import photos
import diagnode from "../../assets/diagnode.PNG"

// import Swiper core and required modules
import SwiperCore, { EffectCoverflow, Pagination } from "swiper/core";

// install Swiper modules
SwiperCore.use([EffectCoverflow, Pagination]);

const projects = [{name:"Diagnode",  img: diagnode},{name:"Diagnode",  img: diagnode},{name:"Diagnode",  img: diagnode}]



function Project() {

  const projectJsx = projects.map(project => {
  return <div className={classes.project}>
      <Swiper
        effect={"coverflow"}
        grabCursor={true}
        centeredSlides={true}
        slidesPerView={"auto"}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={true}
        className={`${classes.mySwiper} ${classes["swiper-container"]}`}
      >
        <SwiperSlide className={classes["swiper-slide"]}>
          <img src={project.img} alt="yes"/>
          <div className={classes.info}>
            <h1 className={classes.title}>Title</h1>
            <p className={classes.description}>This is my website</p>
          </div> 
        </SwiperSlide>
      </Swiper>
    </div>
  });

  return <>{projectJsx}</>


}

export default Project;
